// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

import {Message} from "./axelar/Message.sol";

contract Test {

    uint public testTopic;
    address public testAddress;

    function input(uint id) public {
        bytes memory message = abi.encode(id, msg.sender);
        bytes memory payload = Message.packMessage(
            Message.UN_SUBSCRIBE,
            message
        );

        output(payload);
    }

    function output(bytes memory payload) public {
        (uint _topic, bytes memory _payload) = Message.unPackMessage(payload);
        (uint courseId, address subscriber) = abi.decode(
                _payload,
                (uint, address)
            );
        testTopic = _topic;
        testAddress = subscriber;
    }

    /* create a new message */
    function packMessage(uint _topic, bytes memory _data)
        public
        pure
        returns (bytes memory)
    {
        return abi.encodePacked(_topic, _data);
    }

    /* reveal a message */
    function unPackMessage(bytes memory _data)
        public
        pure
        returns (uint, bytes memory)
    {
        (uint topic, bytes memory data) = abi.decode(_data, (uint, bytes));
        return (topic, data);
    }
}
